import React from 'react';

function WrapNavbar({ children }) {
    return (
        <div className="bg-white border-b" >
            <div className="container " >
                <div className="flex justify-between h-14 items-center md:px-4">
                    {children}
                </div>
            </div>
        </div>
    );
}

export default WrapNavbar;
